import React from 'react';
import './Portfolio.css';
import 'animate.css';
import 'tachyons';


const Portfolio = () => {
  const style ={backgroundImage: 'url(http://mrmrs.github.io/images/0006.jpg)'}
  return (
    <div className="flex flex-wrap">
      <div className="w-100">
        <section className="tc center">
          <h2 className="fw3 f3 white-80 mt3 mb4">/ experience /</h2>
        </section>
      </div>
      <div className="w-third-ns w-100-m">
        <article className="center">
          <div className="tc">

            <h1 className="f3 mb2 moon-gray">Frontend</h1>
            <h2 className="f5 fw4 light-gray mt0">Frontend development primarly with React.</h2>
          </div>
        </article>
      </div>
    </div>

  )
}

export default Portfolio;
